import React from "react";
import './footer.css';
import { BsFacebook, BsInstagram } from "react-icons/bs";
import { MdEmail } from "react-icons/md";

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer__container">
        {/* Section LA BOUTIQUE */}
        <div className="footer__section">
          <h2 className="footer__main-title">LA BOUTIQUE</h2>

          <div className="footer__subsection">
            <h3 className="footer__subtitle">Montrer la ligne</h3>
            <ul className="footer__list">
              <li className="footer__list-item">
                <span className="footer__checkbox">☐</span> Passage de confidentialité
              </li>
              <li className="footer__list-item">Lancement et retours</li>
              <li className="footer__list-item">Règlement conserver</li>
            </ul>
          </div>
        </div>

        {/* Séparateur */}
        <div className="footer__separator"></div>

        {/* Section crédits */}
        <div className="footer__credits">
          Montré par : <span className="footer__credit-name">@tourret.com</span>
        </div>

        {/* Séparateur */}
        <div className="footer__separator"></div>

        {/* Section NOS RÉSEAUX */}
        <div className="footer__section">
          <h2 className="footer__main-title">NOS RÉSEAUX</h2>
          <ul className="footer__list">
            <li className="footer__list-item">Vendue</li>
            <li className="footer__list-item">
              <BsFacebook className="footer__social-icon" /> Fontaine
            </li>
            <li className="footer__list-item">
              <BsInstagram className="footer__social-icon" /> Instagram
            </li>
          </ul>
        </div>

        {/* Séparateur */}
        <div className="footer__separator"></div>

        {/* Section CONTACT */}
        <div className="footer__section">
          <h2 className="footer__main-title">CONTACT</h2>
          <div className="footer__contact-item">
            <MdEmail className="footer__contact-icon" />
            <span>contact.lebotom@gmail.com</span>
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
